# Define negative log-likelihood function
def neg_log_likelihood(params):
    alpha, beta = params
    x = data['skill_diff']/2
    y = data['outcome']
    p = 1 / (1 + np.exp(-(alpha + beta * x)))  # Logistic function
    return -np.sum(y * np.log(p) + (1 - y) * np.log(1 - p))  # Negative Log Likelihood

# Optimize to find best alpha and beta
result = minimize(neg_log_likelihood, [0, 0.01])  # Initial guess: alpha=0, beta=0.01
alpha_mle, beta_mle = result.x

